  false,\n\t\"url\": null,\n\t\"notes\": \"This data set is a spreadsheet resulting
  from monthly searches for dead birds along randomly selected power line segments
  in and near the Snake River Birds of Prey National Conservation Area (NCA) in Southwestern
  Idaho. Data include information regarding causes of mortality, the species of birds
  killed, and details of the equipment associated with the power poles where birds
  were found. Dead birds were recovered along 3-phase distribution lines Data were
  collected between 1999 and 2005.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
